import logo from './radicalx-logo.png';
import './App.css';
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';

function App() {
  return (
    <div className="App">
      <Header />
      <img src={logo} alt="logo" />
      <Footer />
    </div>
  );
}

export default App;
